<p>Estimating the luminance from the sky dome accurately is difficult, see <a href="#bruneton-2010">[3]</a> for some techniques addressing this. We take a simple approach and split into separate specular and diffuse terms, with disjoint sampling strategies. The samples chosen are arbitrary and imprecise, but they work well enough for a visually pleasing scene.</p>
